import React, { Component } from "react";
import { LinkContainer } from "react-router-bootstrap";
import { Nav } from "react-bootstrap";
import "../style/Dashboard.css";

export default class SideMenuElement extends Component {
  render() {
    const dest = "/" + this.props.component;
    const iconClass = "sm-icon fa " + this.props.componentIcon;
    return (
      <LinkContainer to={dest}>
        <Nav.Link className="sm-element">
          <div className="sm-cont-icon">
            <i className={iconClass} aria-hidden="true"></i>
          </div>
          <div className="sm-element-name">{this.props.componentName}</div>
        </Nav.Link>
      </LinkContainer>
    );
  }
}
